  /**
   * @desc Cookie name
   * @return {string}
   */
  name () {
    return this._cookie.name
  }

  /**
   * @desc Cookie value
   * @return {string}
   */
  value () {
    return this._cookie.value
  }

  /**
   * @desc Cookie domain
   * @return {string}
   */
  domain () {
    return this._cookie.domain
  }

  /**
   * @desc Cookie path
   * @return {string}
   */
  path () {
    return this._cookie.path
  }

  /**
   * @desc Cookie expiration date as the number of seconds since the UNIX epox
   * @return {number}
   */
  expires () {
    return this._cookie.expires
  }

  /**
   * @desc The size of the cookie
   * @return {number}
   */
  size () {
    return this._cookie.size
  }

  /**
   * @desc True if the cookie is http-only
   * @return {boolean}
   */
  httpOnly () {
    return this._cookie.httpOnly
  }

  /**
   * @desc True if the cookie is secure (HTTPS)
   * @return {boolean}
   */
  secure () {
    return this._cookie.secure
  }

  /**
   * @desc True in case of session cookie
   * @return {boolean}
